    UPDATE donations d
    SET amount_in_usd = COALESCE(
      (d.amount * er.rate),
      d.amount
    )
    FROM exchange_rates er
    WHERE d.currency = er.currency 
      AND d.date = er.date
      OR d.currency = 'USD';
  